    // returns an array of 15 sounds for page N
    
    init(labelText: String, soundResourceName: String, iconResourceName: String, isFavorite: Bool) {
        self.labelText = labelText
        self.soundResourceName = soundResourceName
        self.iconResourceName = iconResourceName
        self.isFavorite = isFavorite
    }
